const dellBrand="Dell"
const dellLapPrice=40000

//Tv1
const sonyTvName="Sony live series"
const sonyTvRating=4.2
const sonyBrand="Sony"
const sonyTvPrice=40000



export const productDetails={appleWatchName,appleBrand,appleWatchPrice,appleWatchRating,fastTrackBrand,fastTrackWatchRating,fastTrackWatchPrice,casioWatchName,casioBrand,casioWatchRating,casioWatchPrice,
